import { HStack, Heading, Image, Text, VStack } from "@chakra-ui/react";

export default function Home() {
  return (
    <VStack mt={20}>
      <HStack spacing={2}>
        <Image src="icon.png" boxSize={12} borderRadius={15} />
        <Heading color="brand" fontWeight="semibold">
          tomotime
        </Heading>
      </HStack>
    </VStack>
  );
}
